import React from 'react';
import './home.css';

function Home() {
    return (
        <div className="mainContent">

            <div className="leftColumn">
                <h1 className="headingText">Welcome!</h1>
                <h2 className="nameText">I am Giovanni Sylvestre,</h2>
                <p className="subText"> An aspiring software developer</p>
                <button className="exploreButton">Explore Portfolio</button>
            </div>
            <div className="rightColumn">
            </div>

        </div>
    );
}

export default Home;
